window.bookSummaryJSON = "<p>Once upon a time, there were three hungry dinosaurs: Papa Dinosaur, Mama Dinosaur...and a dinosaur who happened to be visiting from Norway. One day - for no particular reason - they decided to tidy up their house, make the beds, and prepare pudding of varying temperatures. And then - for no particular reason - they decided to go...someplace else. They were definitely not setting a trap for some succulent, unsupervised little girl. </p>"; 
